    "necedah-national-wildlife-refuge-narrative-report-january-february-march-and-april-1945",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from January through April of 1945. The report begins by
    summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include timber removal. The public relations section of the report
    describes recreational uses and Refuge visitors. Items of interest and N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
